import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { Card, Button } from 'react-bootstrap';
import { render } from '@testing-library/react';
import './Box.css';

const Arts = () => {
    const cardInfo = [
        {image: 'https://www.messer.com/wp-content/uploads/project-image_The-Andrew_J_Brady_ICON_Music_Center.jpg', title: 'The Andrew J Brady ICON Music Center', text: 'description text', link: 'https://bradymusiccenter.com/'},
        {image: '', title: '', text: ''},
        {image: '', title: '', text: ''},
        {image: '', title: '', text: ''},
    ];

    const renderCard = (card, index) =>{
        return(
            <Card style={{ width: '18rem' }} key={index}>
                <Card.Img variant="top" src={card.image} />
                <Card.Body>
                    <Card.Title>{card.title}</Card.Title>
                    <Card.Text>
                        {card.text}
                    </Card.Text>
                    <Button variant="primary" href={card.link}>Go somewhere</Button>
                </Card.Body>
            </Card>
        )
    }

    return (
        <>
        <div>
            <h1>Arts and Music</h1>
        </div>
        
         <div className='grid'>{cardInfo.map(renderCard)}</div>   
        </>
        
    )
};


export default Arts
